INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 4, 24015, "2030/12/17 14:59:59", 1, 110501, 0.0, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 4);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 4, 24016, "2030/12/17 14:59:59", 2, 110501, 4.0, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 1);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 4, 24017, "2030/12/17 14:59:59", 3, 110501, 0.0, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 4);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 1, 24018, "2030/12/17 14:59:59", 4, 110501, 5.2, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 5, 24019, "2030/12/17 14:59:59", 5, 110501, 4.2, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 6);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 2, 24020, "2030/12/17 14:59:59", 6, 110501, 0.0, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 1, 24021, "2030/12/17 14:59:59", 7, 110501, 6.4, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 6);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 2, 24022, "2030/12/17 14:59:59", 8, 110501, 0.0, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 6, 24023, "2030/12/17 14:59:59", 9, 110501, 10.08, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 3);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 1, 24024, "2030/12/17 14:59:59", 10, 110501, 5.0, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("カオリ（サマー）", 10021, "2019/07/31 12:00:00", 0.0, 2, 24025, "2030/12/17 14:59:59", 11, 110501, 0.0, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 2);
